/**
 * Loads sample inventory items for first-time users.
 *
 * Guard: skips if inventory already has entries (existing user).
 * Assigns a unique serial to each sample item via getNextSerial(),
 * pushes them into the inventory array, and persists with a single
 * saveInventory() call.
 */
function loadSeedInventory() {
  // Guard: existing users already have inventory
  if (typeof inventory !== "undefined" && inventory.length > 0) {
    debugLog("Seed inventory: skipped — inventory already has " + inventory.length + " items");
    return;
  }

  if (typeof getNextSerial !== "function" || typeof saveInventory !== "function") {
    debugLog("Seed inventory: skipped — required functions not available");
    return;
  }

  debugLog("Seed inventory: loading sample items for first-time user...");

  for (const template of SEED_INVENTORY_ITEMS) {
    const item = Object.assign({}, template, { serial: getNextSerial() });
    inventory.push(item);
  }

  saveInventory();
  debugLog("Seed inventory: loaded " + SEED_INVENTORY_ITEMS.length + " sample items");
}

// Export for global access
window.loadSeedSpotHistory = loadSeedSpotHistory;
window.loadSeedInventory = loadSeedInventory;
